import { makeStyles } from '@material-ui/core';

export const useStyles = makeStyles(
  () => ({
    paper: {

    },
    grid: {
      backgroundColor: "#fff",
      border: "1px solid #e0e0e0",
      borderRadius: 10,
      paddingLeft: 40,
      paddingRight: 40,
      paddingTop: 64,
      width: 428,
      height: 566,
      textAlign: "center",
    },
